class Solution {


        int[] left = new int[]{- 1, 0, 1};
        int[] right = new int[]{-1, 0, 1};

    public int shortestPathBinaryMatrix(int[][] grid) {
        Deque<Integer> deque = new ArrayDeque<>();
        int n = grid.length;
        boolean[] visited = new boolean[n * n];
        if (grid[0][0] == 1 || grid[n - 1][n - 1] == 1) {
            return -1;
        }
        deque.add(0);
        int length = 1;
        visited[0] = true;
        while (!deque.isEmpty()) {
            int size = deque.size();
            for (int i = 0; i < size; i++) {
                int current = deque.poll();
                if (current == visited.length - 1) {
                    return length;
                }
                int x = current / n;
                int y = current % n;
                for (int j = 0; j < left.length; j++) {
                    for (int z = 0; z < right.length; z++) {
                        int nx = x + left[j];
                        int ny = y + right[z];
                        if (nx < 0 || ny < 0 || nx >= n || ny>= n || visited[nx *n + ny] || grid[nx][ny] == 1) {
                            continue;
                        }
                        if (nx != x || ny != y) {
                            visited[nx *n + ny] = true;
                            deque.addLast(nx * n + ny);
                        }
                    }

                }

            }
            length++;
        }
        return -1;
    }
}
